import React, { Component } from 'react';
import {withRouter} from 'next/router';
import HomePage from './index';
import '../styles/app.css';

class App extends Component {

    render() {
        return (
            <>
                <HomePage/>
            </>
        );
    }
}

export default withRouter(App);
